fn replace_slice(J, H, R):
K = J.newer.load();
G = H.older.load();
R.newer = K;
R.older = G;
result1 = K.older.comp_exch(J, R); if let Err(Y) = result1:
// Search for the node that has become K in our view.
// O(n), n = num of pushes since a few lines ago.
K = Y;
while K.older.load() != J:
K = K.older.load();
R.newer = K;
K.older.store(R);
G.newer.store(R);

fn replace_slice(K, J, G, R):
R.older = G;
result = K.older.comp_exch(J, R);
if let Err(Y) = result: // Search for the node that has become K in our view.
// O(n), n = num of pushes while R was being built.
K = Y;
while K.older.load() != J:
K = K.older.load();
K.older.store(R);
